import Backdrop from "./Backdrop";

function Todo(props) {
    function deleteTodo(){
        alert("Deleting " + props.text);
    }
  return (
    <div className="card">
      <h2>{props.text}</h2>
      <div className="actions">
        <button className="btn" onClick={deleteTodo}>Delete</button>
      </div>
    </div>
  );
}

export default Todo;
